import AppBar from './components/appBarComponents/AppBar';
import Body from './components/body-components/Body';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import Inicio from './components/Inicio'
import Contacto from './components/Contacto';
import Nosotros from './components/Nosotros';

function App() {



  return (
    <>
      <Router>
                <div className='container'>
                    <div className='btn-gtp'>
                        <Link to='/'>
                          Inicio
                        </Link>
                    </div>  
                    <hr />
                    <Switch>
                        {/*declarar de lo mas especifoco a lo generrar
                        o usar con el exact*/ }
                        {/* este este es un router*/}
                        <Route path='/contacto'>
                          <Contacto>

                          </Contacto>
                        </Route>

                        <Route path='/nostros'>
                            {/* ahi es donde se enrruta */}
                            <Nosotros></Nosotros>

                        </Route>

                        <Route path='/' exact>
                            {/* ahi es donde se enrruta */}
                            <Inicio>

                            </Inicio>

                        </Route>
                    </Switch>
                </div>
            </Router>

      <div>
        <AppBar 

        />
      </div>
      <div class="fondo">
        <Body
        />

      </div>
    </>
  );
}

export default App;
